import { View } from "react-native";

import styles from "./styles";
import GameCardThumbnail from "./components/GameCardThumbnail/GameCardThumbnail";
import GameCardLava from "./components/GameCardLava/GameCardLava";
import GameCardHome from "./components/GameCardHome/GameCardHome";

const testImageUri = "https://reactjs.org/logo-og.png";
const testGameTitle1 = "A game about killing DRAGONS and looting DIAMONDS";
const testGameTitle2 = "FAME & GLORY";

export default function SweatHomeScreen() {
  return (
    <View style={styles.container}>
      <View style={styles.separator}>
        <GameCardHome
          uri={testImageUri}
          title={testGameTitle1}
          friends={10}
          likes={7222}
          labelNew={2}
        />
      </View>
      <View style={styles.separator}>
        <GameCardHome
          uri={testImageUri}
          title={testGameTitle2}
          friends={28}
          likes={9876542}
          labelNew={0}
        />
      </View>
      <View style={styles.separator}>
        <GameCardLava uri={testImageUri} title={testGameTitle1} />
      </View>
      <View>
        <GameCardThumbnail uri={testImageUri} />
      </View>
    </View>
  );
}
